nodes.data:
          

            .legends-box{
                width:50px;
                padding:5px 0 10px;
                border: 1px solid;
            }

            

            .link {
                fill: #666;
                stroke: #666;
                /* stroke-opacity: 2.6; */
            }

            path.link {
                fill: #666;
                stroke: #666;
                /*stroke-width: 1.5px;*/
                stroke-width: 3px;
            }
            circle {
                fill: #ccc;
                stroke: #bbb;
                stroke-width: 3px;
            }
            circle.outer {
                display         : none;
                stroke-dasharray: 4px;
                stroke-opacity  : 0.5;
                fill            : transparent;
            }
            .selected circle.outer {
                display : inline;
            }
            end {
                fill: #666;
                stroke: #666;
                stroke-width: 3px;
            }
            marker {
                fill: #666;
                stroke: #666;
               /* stroke-width: 1.5px;*/
                stroke-width: 3px;
            }
            marker#end {
                fill: #666;
                stroke: #666;
               /* stroke-width: 1.5px; */
               stroke-width: 3px;
            }



            text {
                
                pointer-events: none;
            /*    text-shadow: 0 2px 0 #fff, 2px 0 0 #fff, 0 -2px 0 #fff, -2px 0 0 #fff;*/


            }

            .navbar-brand {
                color: #FFF !important;
            }
            .CodeMirror {
                border: 1px solid #eee;
                height: 100%;
            }
            .CodeMirror-scroll {
                overflow-y: hidden;
                overflow-x: auto;
            }
            .btn.active, .btn:active {
                background-color: #666 !important;
            }



@font-face {
/* we want the svg version */
font-family: 'FontAwesomeSVG';
src: url('bower_components/fontawesome/fonts/fontawesome-webfont.svg?v=4.0.3#fontawesomeregular') format('svg'),
url('bower_components/fontawesome/fonts/fontawesome-webfont.eot?#iefix&v=4.0.3') format('embedded-opentype'),
url('bower_components/fontawesome/fonts/fontawesome-webfont.woff?v=4.0.3') format('woff'),
url('bower_components/fontawesome/fonts/fontawesome-webfont.ttf?v=4.0.3') format('truetype');
font-weight: normal;
font-style: normal;
}

::-moz-selection {
  background: #b3d4fc;
  text-shadow: none;
}

::selection {
  background: #b3d4fc;
  text-shadow: none;
}

html {
  padding: 30px 10px;
  font-size: 20px;
  line-height: 1.4;
  color: #737373;
  background: #f0f0f0;
  -webkit-text-size-adjust: 100%;
  -ms-text-size-adjust: 100%;
}

html,
input {
  font-family: "Helvetica Neue", Helvetica, Arial, sans-serif;
}

body {
  max-width: 500px;
  _width: 500px;
  padding: 30px 20px 50px;
  border: 1px solid #b3b3b3;
  border-radius: 4px;
  margin: 0 auto;
  box-shadow: 0 1px 10px #a7a7a7, inset 0 1px 0 #fff;
  background: #fcfcfc;
}

h1 {
  margin: 0 10px;
  font-size: 50px;
  text-align: center;
}

h1 span {
  color: #bbb;
}

h3 {
  margin: 1.5em 0 0.5em;
}

p {
  margin: 1em 0;
}

ul {
  padding: 0 0 0 40px;
  margin: 1em 0;
}

.container {
  max-width: 380px;
  _width: 380px;
  margin: 0 auto;
}

/* google search */

#goog-fixurl ul {
  list-style: none;
  padding: 0;
  margin: 0;
}

#goog-fixurl form {
  margin: 0;
}

#goog-wm-qt,
#goog-wm-sb {
  border: 1px solid #bbb;
  font-size: 16px;
  line-height: normal;
  vertical-align: top;
  color: #444;
  border-radius: 2px;
}

#goog-wm-qt {
  width: 220px;
  height: 20px;
  padding: 5px;
  margin: 5px 10px 0 0;
  box-shadow: inset 0 1px 1px #ccc;
}

#goog-wm-sb {
  display: inline-block;
  height: 32px;
  padding: 0 10px;
  margin: 5px 0 0;
  white-space: nowrap;
  cursor: pointer;
  background-color: #f5f5f5;
  background-image: -webkit-linear-gradient(rgba(255,255,255,0), #f1f1f1);
  background-image: -moz-linear-gradient(rgba(255,255,255,0), #f1f1f1);
  background-image: -ms-linear-gradient(rgba(255,255,255,0), #f1f1f1);
  background-image: -o-linear-gradient(rgba(255,255,255,0), #f1f1f1);
  -webkit-appearance: none;
  -moz-appearance: none;
  appearance: none;
  *overflow: visible;
  *display: inline;
  *zoom: 1;
}

#goog-wm-sb:hover,
#goog-wm-sb:focus {
  border-color: #aaa;
  box-shadow: 0 1px 1px rgba(0, 0, 0, 0.1);
  background-color: #f8f8f8;
}

#goog-wm-qt:hover,
#goog-wm-qt:focus {
  border-color: #105cb6;
  outline: 0;
  color: #222;
}

input::-moz-focus-inner {
  padding: 0;
  border: 0;
}
